import { getMovieById, getMovies, addMovie } from "./db";
import routes from "./routes";

export const home = (req, res) =>
  res.render("movies", { movies: getMovies(), pageTitle: "Movies!" });

export const movieDetail = (req, res) => {
  const {
    params: { id }
  } = req;
  const movie = getMovieById(id);
  if (!movie) {
    res.render("404", { pageTitle: "Movie not found" });
  }
  return res.render("detail", { movie });
};

export const getAdd = (req,res)=> res.render("add")

export const postAdd = async(req,res)=> {

  const {
    body:{title,synopsis, genres}
  }=req;

  console.log(genres.split(','))
  const genresArr = genres.split(',')

  // console.log(title,synopsis,genres);
  // console.log(typeof(title), typeof(synopsis), typeof(genres));
  //save to DB 
  const movie ={
    title: title,
    synopsis: synopsis,
    genres:genresArr
  }
  const newMovie  = await addMovie(movie)
  /*
  If you want to redirect to detail with newMoive id 


  // console.log(newMovie.id);
  // res.redirect(routes.detail(newMovie.id))

  */
  res.render("movies", { movies: getMovies(), pageTitle: "Movies!" });


  // console.log(req.body.title);
}

